/// <summary>
/// Retrives a list of selected sales order for sales order confirmation processing.
/// </summary>
/// <returns>
/// A list of selected sales order in the proper format to be processed by <c>SalesFormLetter</c> framework.
/// </returns>
container getSelectedOrders()
{
    Map mapTradeRecord = new Map(typeName2Type(extendedTypeStr(RecId)), Types::Record);

    SalesTable salesTableLocal;

    for (salesTableLocal = SalesTable_ds.getFirst(true)
                ? SalesTable_ds.getFirst(true)
                : SalesTable_ds.cursor();
    salesTableLocal;
    salesTableLocal = SalesTable_ds.getNext())
    {
        salesTable = SalesTable::find(salesTableLocal.SalesId);

        mapTradeRecord.insert(salesTable.RecId, salesTable);
    }

    return mapTradeRecord.pack();
}
